import React from 'react';
import classes from './Button.module.css'


interface Props {
	id: string;
}


export const Button = ({ id }: Props) => {

	switch (id) {
		case 'button_CreateTask':
			return (
				<button className={classes.button_text}><p>CREATE TASK</p></button>
			)


			case 'button_LogOut':
				return (
					<button className={classes.button_text}><p>LOG OUT</p></button>
				)
	



			default:
				return <button></button>;
	
	
		}
	}
